this.Templates=this.Templates||{},this.Templates.contact=Handlebars.template(function(a,b,c,d,e){return this.compilerInfo=[4,">= 1.0.0"],c=this.merge(c,a.helpers),e=e||{},'<div class="row">\n	<h3>We must talk. We simply must.</h3>\n</div>\n\n<div class="row">\n	<div class="small-12 columns content">\n		<p>Getting hold of me is pretty easy. For reasons of personal privacy, I\'ve ommited the details of the most immediate and noisy devices from this page, but you can always email me at <strong>iam [at] yourheropaul.com</strong> or buzz me on Skype at <strong>yourheropaul</strong>. I\'m always up for a Google Hangout.</p>\n	</div>\n</div>\n\n<div class="row push-down">\n	<div class="small-12 medium-6 large-3 columns links">\n		<a class="link large button expand quaternary-background-colour" href="" data-link="mailto:iam@yourheropaul.com">Email me</a>\n	</div>\n	<div class="small-12 medium-6 large-3 columns links">\n		<a class="link large button expand tertiary-background-colour" href="" data-link="skype:yourheropaul?call">Skype me</a>\n	</div>\n	<div class="small-12 medium-6 large-3 columns links">\n		<a class="link large button expand senary-background-colour" href="" data-link="tel:+447429142570">Call me</a>\n	</div>\n	<div class="small-12 medium-6 large-3 columns links">\n		<a class="large button expand secondary-background-colour" href="https://github.com/yourheropaul/yourheropaul.github.io" target="_blank">My Github</a>\n	</div>\n</div>\n\n<div class="row charts">\n	<h4>How I typically use communications tools</h4>\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Time allocation</h5>\n		<canvas id="dougnut-split" class="doughnut" width="300" height="60"></canvas>\n	</div>\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Tools leading to new work</h5>\n		<canvas id="dougnut-new-work" class="doughnut" width="300" height="60"></canvas>\n	</div>\n</div>'}),this.Templates.index=Handlebars.template(function(a,b,c,d,e){this.compilerInfo=[4,">= 1.0.0"],c=this.merge(c,a.helpers),e=e||{};var f,g,h="",i=c.helperMissing,j=this.escapeExpression;return h+='<div class="row">\n	<h3>Hello! I make web applications</h3>\n</div>\n\n<div class="row">\n	<div class="hexagons">\n		<a href="#tech" title="What I do">\n			<div class="secondary hexagon first-order">\n				<div class="component a">\n					<p>\n						<i class="fa fa-bar-chart-o fa-2x" />\n					</p>\n					<hr />\n					<p>Tech stuff</p>\n				</div>\n				<div class="component b"></div>\n				<div class="component c"></div>\n			</div>\n		</a>\n		<div class="spacer"></div>\n		<a href="#contact" title="Contact me">\n			<div class="quaternary hexagon first-order">\n				<div class="component a">\n					<p>\n						<i class="fa fa-microphone fa-2x" />\n					</p>\n					<hr />\n					<p>Contact me</p>\n				</div>\n\n				<div class="component b"></div>\n				<div class="component c"></div>\n			</div>\n		</a>\n		<br />\n		<a href="#work/cruk" title="Case study: CRUK">\n			<div class="septenary hexagon second-order">\n				<div class="component a">\n					<p>\n						Work\n					</p>\n					<hr />\n					<p>CRUK</p>\n				</div>\n				<div class="component b"></div>\n				<div class="component c"></div>\n			</div>\n		</a>\n		<div class="spacer"></div>\n		<a href="#work/unicef" title="Case study: UNICEF">\n			<div class="senary hexagon second-order">\n				<div class="component a">\n					<p>\n						Work\n					</p>\n					<hr />\n					<p>UNICEF</p></div>\n				<div class="component b"></div>\n				<div class="component c"></div>\n			</div>\n		</a>\n		<div class="spacer"></div>\n		<a href="#benefactors" title="Benefactors">\n			<div class="tertiary hexagon second-order">\n				<div class="component a">\n					<p>\n						Giants, shoulders\n						 <br /><i class="fa fa-ticket fa-2x" /><br />\n						and so forth\n					</p>\n				</div>\n				<div class="component b"></div>\n				<div class="component c"></div>\n			</div>\n		</a>\n		<a href="https://github.com/yourheropaul/yourheropaul.github.io" target="_blank" title="Source code for this site">\n			<div class="quinary hexagon second-order">\n				<div class="component a"><i class="fa fa-github fa-2x large" /></div>\n				<div class="component b"></div>\n				<div class="component c"></div>\n			</div>\n		</a>\n		<div class="spacer"></div>\n		<a href="#tech" title="What I do">\n			<div class="octonary hexagon second-order promo-graphs">\n				<div class="component a"></div>\n				<div class="component b"></div>\n				<div class="component c"></div>\n			</div>\n		</a>\n		<br />\n		<a href="http://whereischristopherlambert.tumblr.com/" target="_blank" title="Where is Christopher Lambert?">\n			<div class="hexagon second-order promo-lambert">\n				<div class="component a"></div>\n				<div class="component b"></div>\n				<div class="component c"></div>\n			</div>\n		</a>\n	</div>\n</div>\n<div class="row" id="charts">\n	<h4>What I do, at a glance</h4>\n	<div class="small-10 small-centered medium-5 medium-uncentered medium-push-1 large-4 large-reset-order columns chart">\n		<canvas id="dougnut-life" class="small doughnut" width="300" height="60"></canvas>\n	</div>\n	<div class="small-10 small-centered medium-5 medium-uncentered medium-push-1 large-4 large-reset-order columns chart">\n		<canvas id="dougnut-code" class="small doughnut" width="300" height="60"></canvas>\n	</div>\n	<div class="small-10 small-centered medium-5 large-4 large-uncentered large-reset-order columns chart">\n		<canvas id="dougnut-overall" class="small doughnut" width="300" height="60"></canvas>\n	</div>\n</div>\n<div class="row call-to-action" id="charts">\n	<a href="#tech"><i class="fa fa-bars"></i> More about my what I do <i class="fa fa-caret-right"></i></a>\n</div>\n<div class="row">\n	<h4>I want to work for you</h4>\n	<div class="small-12 medium-6 columns content">\n		<p>I\'ve been lucky.</p>\n		<p>Really, stupid, Zack-Morris-lucky. Over the years, I’ve had the fortune to work with the best people to build some of the world’s most demanding sites and apps. I’ve managed to make problem-solving, my dyed-in-the-wool interest, into a career that has spanned three continents. Having high stand- ards has helped, for sure; showing up every day and never giving up when things got tough didn’t hurt either, but that’s not why I got to where I am.</p>\n		<p>I\'m here because of people like you.</p>\n	</div>\n	<div class="small-12 medium-6 columns content no-lead">\n		<p>Who are you? You’re the sort of person who gets things done, who organises teams, who plans and calculates and makes things that improve the world. You’re a producer and, if you’re reading this, you have a product I want to get in on.</p>\n		<p>What I do is make your ideas a reality, in the best possible way. I’m not interested in ego and I don’t care about hierarchy: I care about the bottom line, and about why we do what we do.</p>\n		<p>You have something you want to make, something amazing. I want you help you make it.</p>\n	</div>\n</div>\n<br/>\n<br/>\n<div class="row call-to-action" id="charts">\n	<a href="#benefactors"><i class="fa fa-bars"></i> What I\'ve done for other people <i class="fa fa-caret-right"></i></a>\n</div>\n<div class="row">\n	<h4>Reviews</h4>\n	<div class="small-12 medium-6 large-4 columns reviews">\n		<p class="quote">\n			<i class="fa fa-quote-left fa-1x"/> <span>Consistently tolerable...</span><br/>oddly compelling. <i class="fa fa-quote-right fa-1x"/>\n		</p>\n		<p class="rating">\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star-half-full fa-2x"/>\n			<br />\n			Andrew Brace, peer.\n		</p>\n	</div>\n	<div class="small-12 medium-6 large-4 columns reviews">\n		<p class="quote">\n			<i class="fa fa-quote-left fa-1x"/> <span>An excellent developer.</span> <i class="fa fa-quote-right fa-1x"/>\n		</p>\n		<p class="rating">\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<br />\n			Josephe Denne, employer.\n		</p>\n	</div>\n	<div class="small-12 medium-6 medium-centered large-uncentered large-4 mall-push-3 columns reviews">\n		<p class="quote">\n			<i class="fa fa-quote-left fa-1x"/> <span>A gentleman of substance</span><br/>who, it seems, can both<br/><span>read and write.</span> <i class="fa fa-quote-right fa-1x"/>\n		</p>\n		<p class="rating">\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<i class="fa fa-star fa-2x"/>\n			<br />\n			Christopher Lambert, patron.\n		</p>\n	</div>\n	<br/><br/>\n</div>\n\n',g={hash:{},data:e},h+=j((f=c.partial||b&&b.partial,f?f.call(b,"partials/contact",g):i.call(b,"partial","partials/contact",g)))+"\n"}),this.Templates["partials/contact"]=Handlebars.template(function(a,b,c,d,e){return this.compilerInfo=[4,">= 1.0.0"],c=this.merge(c,a.helpers),e=e||{},'<div class="row">\n	<h4>Get in contact</h4>\n\n	<div class="small-12 medium-6 medium-push-3 columns content centered">\n		<p>I\'m always looking for new opportunities, and it never hurts to drop a line. The quickest way of contacting me is via email, and from there we\'d typically move on to Skype, Google Hangouts or - for historians - a face-to-face-meeting.</p>\n		<p class="standout">\n			<i class="fa fa-envelope-square"></i> iam [at] yourheropaul.com<br />\n			<i class="fa fa-skype"></i> yourheropaul<br />\n			<i class="fa fa-microphone"></i> +44 7429142570<br />\n		</p>\n	</div>\n</div>'}),this.Templates.tech=Handlebars.template(function(a,b,c,d,e){this.compilerInfo=[4,">= 1.0.0"],c=this.merge(c,a.helpers),e=e||{};var f,g,h="",i=c.helperMissing,j=this.escapeExpression;return h+='<div class="row">\n	<h3>Oh, I have pie charts.</h3>\n</div>\n\n<div class="row">\n	<div class="small-12 columns content">\n		<p>From compilation to configuration, installation to development, front-end to back-end, I have years of proven, refined and tested experience. I\'ve successfully engineered <a href="#work/cruk">very large applications</a>, and built <a href="#work/skeptunes">very small ones</a>. I have spent years sniffing out solutions to some of the third sector\'s most difficult computer science problems. I\'m sort of like Sherlock Holmes, at least in as far as I have a debilitating addiction. To statistics.</p>\n	</div>\n</div>\n\n<div class="row charts">\n	<h4>Overview of what I do</h4>\n	<div class="small-12 columns chart content">\n		<ul class="bar-chart">\n			<li class="axis">\n				<div class="label">Unrivaled</div>\n				<div class="label">Expert</div>\n				<div class="label">Accomplished</div>\n				<div class="label">Skilled</div>\n				<div class="label">Proficient</div>\n			</li>\n			<li class="bar secondary" style="height: 95%;" title="Web app development - 95%">\n				<div class="percent">95<span>%</span></div>\n				<div class="skill">Web app development</div>\n			</li>\n			<li class="bar tertiary" style="height: 90%;" title="Database design - 90%">\n				<div class="percent">90<span>%</span></div>\n				<div class="skill">Database design</div>\n			</li>\n			<li class="bar quaternary" style="height: 70%;" title="Copywriting - 70%">\n				<div class="percent">70<span>%</span></div>\n				<div class="skill">Copywriting</div>\n			</li>\n			<li class="bar quinary" style="height: 60%;" title="Responsive web design - 60%">\n				<div class="percent">60<span>%</span></div>\n				<div class="skill">Responsive web design</div>\n			</li>\n			<li class="bar senary" style="height: 85%;" title="Systems programming - 85%">\n				<div class="percent">85<span>%</span></div>\n				<div class="skill">Systems programming</div>\n			</li>\n		</ul>\n\n		<p>Note: the above are general estimations, produced scientifically as product of my observations of the natural world and my unrelenting ego. The following charts are based on harder data. Please also note that I will omit any data about copywriting, on account of its subjective nature.</p>\n	</div>\n	<div class="small-12 columns chart content">\n		<h5>Number of projects delivered</h5>\n		<canvas id="deployments-area" class="area" height="420px"></canvas>\n		<p>Note: The distinction between <em>web apps</em> and <em>web sites</em> is often blurry and ill-defined. For the purposes of this graph, I have assumed than a product is an \'app\' rather than a \'site\' when the amount of backend code written for the purposes of the project exceeds the amount of code written for the front end. Over the last few years, I\'ve rolled out apps very quickly by developing a set of frameworks, and code committed to the frameworks themselves counts as backend development.</p>\n	</div>\n</div>\n<div class="row" id="charts">\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Time imvestment</h5>\n		<canvas id="dougnut-time-investment" class="doughnut" width="300" height="60"></canvas>\n	</div>\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Output transparency</h5>\n		<canvas id="dougnut-output-transparency" class="doughnut" width="300" height="60"></canvas>\n	</div>\n</div>\n\n<div class="row" id="charts">\n\n	<h4>Backend and systems programming</h4>\n\n	<div class="mobile-10 mobile-centered medium-uncentered medium-6 medium-reset-order columns chart content">\n		<h5>Language <span class="secondary-text-colour">expertise</span> vs <span class="senary-text-colour">fondness</span></h5>\n		\n		<canvas id="language-radar" class="radar" width="300" height="460"></canvas>\n\n		<ul class="legend">\n			<li class="secondary-background-colour">expertise</li>\n			<li class="senary-background-colour">Fondness</li>\n		</ul>\n	</div>\n	<div class="mobile-10 mobile-centered medium-uncentered medium-6 medium-reset-order columns chart content">\n		<h5>Paradigm <span class="secondary-text-colour">expertise</span> vs <span class="senary-text-colour">fondness</span></h5>\n\n		<canvas id="paradigm-radar" class="radar" width="300" height="60"></canvas>\n\n		<ul class="legend">\n			<li class="secondary-background-colour">expertise</li>\n			<li class="senary-background-colour">Fondness</li>\n		</ul>\n	</div>\n</div>\n<div class="row" id="charts">\n	<div class="medium-12 large-5 columns chart content">\n		<h5>Language experience</h5>\n		<ul class="bar-chart horizontal align-right">\n			<li class="bar secondary" style="width: 35%;" title="Go">\n				<div class="percent">2 <span>years</span></div>\n				<div class="skill show-for-medium-down">Go</div>\n			</li>\n			<li class="bar tertiary" style="width: 90%;" title="PHP">\n				<div class="percent">7+<span> years</span></div>\n				<div class="skill show-for-medium-down">PHP</div>\n			</li>\n			<li class="bar quaternary" style="width: 45%;" title="Node.js">\n				<div class="percent">3 <span>years</span></div>\n				<div class="skill show-for-medium-down">Node.js</div>\n			</li>\n			<li class="bar septenary" style="width: 60%;" title="Ruby">\n				<div class="percent">4 <span>years</span></div>\n				<div class="skill show-for-medium-down">Ruby</div>\n			</li>\n			<li class="bar quinary" style="width: 100%;" title="C/C++">\n				<div class="percent">10+ <span>years</span></div>\n				<div class="skill show-for-medium-down">C/C++</div>\n			</li>\n			<li class="bar senary" style="width: 60%;" title="Python">\n				<div class="percent">4 <span>years</span></div>\n				<div class="skill show-for-medium-down">Python</div>\n			</li>\n		</ul>\n	</div>\n	<div class="show-for-large-only medium-2 columns chart content">\n		<h5>Language</h5>\n		<ul class="bar-chart horizontal">\n			<li class="full bar secondary" title="GO">\n				<div class="skill">Go</div>\n			</li>\n			<li class="full bar tertiary"  title="GO">\n				<div class="skill">PHP</div>\n			</li>\n			<li class="full bar quaternary" title="GO">\n				<div class="skill">Node.js</div>\n			</li>\n			<li class="full bar septenary" title="GO">\n				<div class="skill">Ruby</div>\n			</li>\n			<li class="full bar quinary" title="GO">\n				<div class="skill">C/C++</div>\n			</li>\n			<li class="full bar senary" title="GO">\n				<div class="skill">Python</div>\n			</li>\n		</ul>\n	</div>\n	<div class="medium-12 large-5 columns chart content">\n		<h5>Language utilisation (5 year average)</h5>\n		<ul class="bar-chart horizontal">\n			<li class="bar secondary" style="width: 85%;" title="95">\n				<div class="percent">21 <span>projects</span></div>\n				<div class="skill show-for-medium-down">Go</div>\n			</li>\n			<li class="bar tertiary" style="width: 100%;" title="90">\n				<div class="percent">38 <span>projects</span></div>\n				<div class="skill show-for-medium-down">PHP</div>\n			</li>\n			<li class="bar quaternary" style="width: 50%;" title="70">\n				<div class="percent">4 <span>projects</span></div>\n				<div class="skill show-for-medium-down">Node.js</div>\n			</li>\n			<li class="bar septenary" style="width: 70%;" title="85">\n				<div class="percent">14 <span>projects</span></div>\n				<div class="skill show-for-medium-down">Ruby</div>\n			</li>\n			<li class="bar quinary" style="width: 60%;" title="50">\n				<div class="percent">10 <span>projects</span></div>\n				<div class="skill show-for-medium-down">C/C++</div>\n			</li>\n			<li class="bar senary" style="width: 55%;" title="85">\n				<div class="percent">5 <span>projects</span></div>\n				<div class="skill show-for-medium-down">Python</div>\n			</li>\n		</ul>\n	</div>\n</div>\n<div class="row">\n	<div class="content columns">\n		<p>Note: the values for <em>language utilisation</em> above are for the principal components for the products themselves, and doesn\'t include any supporting applications or tools. For example, I have built many frontend applications using grunt.js as a workflow, deployed to servers using Capistrano, and built small proxies for Go applications in PHP. These minor works were not considered.</p>\n		<br />\n		<br />\n	</div>\n</div>\n\n<div class="row" id="charts">\n	<h4>Frontend programming and presentational markup</h4>\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Major framework experience</h5>\n		<canvas id="polar-framework" class="polar" width="300" height="60"></canvas>\n	</div>\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Markup generation <span class="secondary-text-colour">expertise</span> vs <span class="senary-text-colour">fondness</span></h5>\n\n		<canvas id="radar-markup" class="radar" width="300" height="60"></canvas>\n\n		<ul class="legend">\n			<li class="secondary-background-colour">expertise</li>\n			<li class="senary-background-colour">Fondness</li>\n		</ul>\n	</div>\n</div>\n<div class="row">\n	<div class="content columns">\n		<p>Note: it may seem out of place to feature a polar area chart for <em>major framework experience</em>, as opposed to an expertise-vs-fondness radar chart. The rationality here is that, whereas programming languages and markup generation workflows are generally monolithic (or at least discreetly separated), it is fairly common for frontend application to combine framework approaches.</p>\n		<p>This complicates even a non-scientific calculation of fondness. How does one figure one\'s love for something as plasic as jQuery? It was tempting to produce a two-dimensional grid of charts plotting my fondness and experience with combinations of frameworks, where applicable &#8212; but that (and I fully appreciate the irony of this statement) would have been data overkill.</p>\n	</div>\n</div>\n<div class="row show-for-medium-up">\n	<div class="small-12 columns chart content">\n		<h5>Lines of code written and committed, by application layer (six month sample, excluding libraries)</h5>\n		<canvas id="committed-bar" class="stacked-bar" height="420px"></canvas>\n	</div>\n</div>\n\n<div class="row charts">\n	<h4>How I typically spend my work time</h4>\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Overall split</h5>\n		<canvas id="dougnut-time-overall" class="doughnut" width="300" height="60"></canvas>\n	</div>\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Programming breakdown</h5>\n		<canvas id="dougnut-time-programming" class="doughnut" width="300" height="60"></canvas>\n	</div>\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Software design breakdown</h5>\n		<canvas id="dougnut-time-design" class="doughnut" width="300" height="60"></canvas>\n	</div>\n	<div class="small-12 small-centered medium-6 medium-uncentered medium-push-1 large-6 medium-reset-order large-uncentered columns chart content">\n		<h5>Talk-time breakdown</h5>\n		<canvas id="dougnut-time-talking" class="doughnut" width="300" height="60"></canvas>\n	</div>\n	<div class="content columns">\n		<p>Note: the data for these time breakdowns are drawn party from observations in the field, and partly from post-event analysis, which has a chance of being influenced by the normal cogitive biases.</p>\n	</div>\n</div>\n\n<div class="row content content-only">\n	<div class="small-12 columns">\n		<h4>Any questions?</h4>\n\n		<p>Despite the overwhelming amount of data on this page, it has not been possible for me to cover every possible avenue of investigation into my professional activities. Web application development is an extremely broad arena, and there is no way any sane person would tolerable the quanity of graphs required to express the entirety of my experience.</p>\n\n		<p>If I\'ve missed something, does that mean I have no experience with it? Well maybe, but maybe not. The best way to find out is to <a href="#contact">contact me</a>.</p>\n\n		<p>Finally, in caase you\'re interested, the source code for this site is <a href="https://github.com/yourheropaul/yourheropaul.github.io" target="_blank" title="Source code for this site"> available on Github</a> and comprises many of the technologies and some of the languages discussed on this page.</p>\n	</div>\n</div>\n\n',g={hash:{},data:e},h+=j((f=c.partial||b&&b.partial,f?f.call(b,"partials/contact",g):i.call(b,"partial","partials/contact",g)))+"\n"});